import * as React from "react";
import PropTypes from "prop-types";
import AddIcon from "@mui/icons-material/Add";
import Button from "@mui/material/Button";
import { styled } from "@mui/material/styles";
import Dialog from "@mui/material/Dialog";
import DialogTitle from "@mui/material/DialogTitle";
import DialogContent from "@mui/material/DialogContent";
import DialogActions from "@mui/material/DialogActions";
import IconButton from "@mui/material/IconButton";
import CloseIcon from "@mui/icons-material/Close";
import axios from "axios";
import Typography from "@mui/material/Typography";
import {
  Alert,
  MenuItem,
  NativeSelect,
  Snackbar,
  TextField,
} from "@mui/material";
import axiosConfig from "../../../../api/configapi";
import { useForm } from "react-hook-form";

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": {
    padding: theme.spacing(2),
  },
  "& .MuiDialogActions-root": {
    padding: theme.spacing(1),
  },
}));

const BootstrapDialogTitle = (props) => {
  const { children, onClose, ...other } = props;

  return (
    <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
      {children}
      {onClose ? (
        <IconButton
          aria-label="close"
          onClick={onClose}
          sx={{
            position: "absolute",
            right: 8,
            top: 8,
            color: (theme) => theme.palette.grey[500],
          }}
        >
          <CloseIcon />
        </IconButton>
      ) : null}
    </DialogTitle>
  );
};

BootstrapDialogTitle.propTypes = {
  children: PropTypes.node,
  onClose: PropTypes.func.isRequired,
};

export default function CreateTask({ setRefreshUi }) {
  const [open, setOpen] = React.useState(false);
  const [addText, setAddText] = React.useState("");
  const [selectTask, setSelectTask] = React.useState(0);
  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  const [openSnackbar, setOpenSnackbar] = React.useState(false);
  const handleOpenSnackbar = () => {
    setOpen(false);
    setOpenSnackbar(true);
  };
  const handleSnackBarClose = () => {
    setOpenSnackbar(false);
  };
  // const [success, setSuccess] = React.useState(true);

  const handleCreate = (data) => {
    axiosConfig.post(`/services/app/Task/Save`, data).catch(() => {
      setOpen(false);
    });
    handleOpenSnackbar();
  };
  const { handleSubmit, register } = useForm();
  const handleSubmitm = () => {
    if (selectTask === "1") {
      axiosConfig.post("/services/app/Task/Save`, data", { title: addText });
    } else {
      axios.post("http://localhost:3000/data1", { title: addText });
    }
    setOpen(false);
  };

  return (
    <div>
      <Snackbar
        open={openSnackbar}
        anchorOrigin={{ vertical: "bottom", horizontal: "right" }}
        onClose={handleSnackBarClose}
        autoHideDuration={2000}
      >
        <Alert
          variant="filled"
          severity="success"
          onClose={handleSnackBarClose}
        >
          {`Created Task`}
        </Alert>
      </Snackbar>
      <Button
        style={{ background: "#f24b50", height: "40px" }}
        variant="contained"
        startIcon={<AddIcon />}
        onClick={handleClickOpen}
      >
        New Task
      </Button>
      <div className="form" style={{ width: "300px" }}>
        <form onSubmit={handleSubmit(handleCreate)} style={{ width: "300px" }}>
          <BootstrapDialog
            onClose={handleClose}
            aria-labelledby="customized-dialog-title"
            open={open}
          >
            <BootstrapDialogTitle
              id="customized-dialog-title"
              onClose={handleClose}
            >
              New Task
            </BootstrapDialogTitle>
            <DialogContent sx={{ width: "300px" }} dividers>
              <Typography gutterBottom>
                <TextField
                  label="Name *"
                  variant="standard"
                  style={{ width: "100%" }}
                  {...register("name", { required: true })}
                />
              </Typography>
              <Typography gutterBottom>
                <TextField
                  select
                  label="Task type"
                  variant="standard"
                  style={{ width: "100%", fontSize: "14px" }}
                  {...register("type", { required: true })}
                >
                  <MenuItem value={0}>Common Task</MenuItem>
                  <MenuItem value={1}>Other Task</MenuItem>
                </TextField>
              </Typography>
            </DialogContent>
            <DialogActions>
              <Button autoFocus onClick={handleSubmit}>
                Save changes
              </Button>
            </DialogActions>
          </BootstrapDialog>
        </form>
      </div>
    </div>
  );
}
